    false,nt"url": null,nt"notes": "The objectives of this Safety Management
    Plan are to identify and define safety hazards that may be encountered on Agassiz
    Refuge and the procedures to be followed in meeting them. Included is emergency
    information, procedures for safety training and safe job operation, instruction
    for proper use of particular refuge tools and equipment, guidelines for use of personal
    protective equipment and guidelines to protect the public. The Plan will be particularly
    useful for indoctrinating new employees. It must be recognized that a guide such
    as this cannot be all inclusive and it is impossible to list all hazards for every
    job on the area. Its principal value is identification of the most potentially dangerous
    job hazards, and the inclusion of information to help workers avoid these hazards
    when encountered. As new job hazards are identified, they will be listed within.
    A continual effort will be made to minimize and eliminate hazards on all jobs. The
    foundation of our safety program is related to the safety attitude of its employees.
    The maintenance of a positive attitude toward safety by all employees will help
    this station maintain an excellent safety record. Supervisors and co-workers will
    provide the best incentive to new employees to perform duties in a proficient, efficient
    and safe manner.",nt"license_title": "License Not Specified",nt"extras":
